import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import CategoriBox from "../UI/CategoriBox";
import Footer from "../Components/Footer";

import "../fonts/fonts.css";
import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const SmoothieKing = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#666666" />

      <div
        style={{
          background: "url(images/sub_smoothieking_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      >
        <SubPortfolioInfo />

        <SiteButton
          className={classes.composeBtn}
          btnColor="#e35c5b"
          textColor="#ffffff"
          top="775px"
          left="370px"
          link="smoothieking/index.html"
        />
      </div>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#e35c5b"
        textColor="#ffffff"
        width="452px"
        top="7110px"
        left="50%"
        link="smoothieking/index.html"
        transX="-50%"
      />

      <Footer footerTop="7250px" />
      {/* <img src="images/smoothie_king.png" alt="스무디킹" /> */}
    </div>
  );
};

export default SmoothieKing;
